import React, { Component } from 'react';
import AlienClockDisplay from './alienClockDisplay';
import SetAlienClockButton from './setAlienClockButton';

// ...

class AlienClockApp extends Component {
  // ...
  constructor(props) {
    super(props);

    // Get the current system time
    const now = new Date();

    this.state = {
      alienYear: now.getFullYear(),    // Get the current year
      alienMonth: now.getMonth() + 1, // Get the current month (0-based)
      alienDay: now.getDate(),         // Get the current day of the month
      alienHour: now.getHours(),       // Get the current hour (24-hour format)
      alienMinute: now.getMinutes(),   // Get the current minute
      alienSecond: now.getSeconds(),   // Get the current second
    };
  }

  

  render() {
    const {
      alienYear,
      alienMonth,
      alienDay,
      alienHour,
      alienMinute,
      alienSecond,
    } = this.state;

    return (
      <div className="App">
        <AlienClockDisplay
          alienYear={alienYear}
          alienMonth={alienMonth}
          alienDay={alienDay}
          alienHour={alienHour}
          alienMinute={alienMinute}
          alienSecond={alienSecond}
        />
        <SetAlienClockButton onClick={this.setAlienClock} />
      </div>
    );
  }
}

export default AlienClockApp;
